import React, { Fragment, useEffect, useState } from 'react';
import marvel from '../../services/instance';

const Home = () => {
  const [series, setSeries] = useState([]);

  useEffect(async () => {
    const newSeries = await marvel.get('/series');
    setSeries(newSeries);
  });
  return <Fragment></Fragment>;
};
export default Home;
